import React from "react";

const mystyle = {
    color: 'white', 
    fontSize: "25px", 
    fontFamily: "serif",
    text

  }

const About = () =>{
    return(
        <about>
            <div>
        
                <div className="about" style={mystyle} >
                Founded in 2022, in Cabadbaran, the first Burger N'Bite opened with one single notion in mind; 
                to serve a better burger and, in the process, helped create a new category.
                The every bite a better burger experience is known for their namesake smashing technique
                 – smashing a fresh, never frozen, 100% Certified Angus Beef hand-packed ball of meat on a hot seasoned grill – 
                delivering an elevated burger experience, where every bite is made to savor.
                </div>
            </div>
        </about>
    )
}
export default About;
